import React from 'react'
import "./Sidebar.css"
import ChatIcon from '@material-ui/icons/Chat';

const Sidebar = () => {
  return (
    <div className='sidebar'>
        <div className="sidebar__header">
            <div className="sidebar__headerRight">
                <ChatIcon/>
            </div>
        </div>
    </div>
  )
}

export default Sidebar
